import React from "react";
import  './css/TodoCounter.css'
function TodoCounter({ totalTodos, completedTodos}){
    
    console.log(completedTodos);
    return(
        <h2 className="todoCounter">Has completado {completedTodos} de {totalTodos}</h2>
    );
}
 
export  {TodoCounter};
